    [],nt"revision_timestamp": "2016-07-27T22:57:25.461529",nt"name": "survey-of-potential-habitat-for-the-eastern-glass-lizard-ophisaurus-ventralis",nt"isopen":
    false,nt"url": null,nt"notes": "Ecosystem Management and Associates, Inc.
    (EM&A) was contracted by the Federal Highway Administration (FHWA) to survey and
    record for the presence or absence of Eastern Glass Lizards (Ophisaurus ventralis),
    locations of dens, and other general population indicators. The survey area as identified
    by Back Bay National Wildlife Refuge (NWR) staff encompasses approximately 1/2 acre
    of potential habitat near the south end of Sandpiper Road, which leads to the NWR
    Visitor's Center located in the City of Virginia Beach, VA. EM&A conducted a total
    of six field surveys consisting of two early morning surveys, two afternoon/evening
    surveys, and two nighttime surveys in May and September 2009. No glass lizards were
    encountered during the surveys. Other species, including other reptiles and potential
    prey species for glass lizards were observed. Descriptions of the methods employed
    to survey for glass lizards and a list of all species encountered during the surveys
    are documented in this report.",nt"license_title": "License Not Specified",nt"extras":
